MongoDB Aggregation: Use field value of current document in $match $or query<p>I have an aggregation pipeline and my documents are currently in the following format :</p>

<pre><code>{
    "user": "5e3d326537df7e4dda73eb23",
    "sharedWithGroups": [ "5e3d326437df7e4dda73eb13", "5e3d326437df7e4dda73eb19" ],
    "userGroupIds": [ "5e3d326437df7e4dda73eb19" ]
}
</code></pre>

<p>Where <code>userGroupIds</code> is the result of a previous stage, where I find the IDs of the groups that the user is in.</p>

<p>I'm trying to add a match stage to the pipeline to find all documents which have either a user ID that matches a specific ID, OR have a <code>sharedWithGroups</code> property that contains one of the entries in <code>userGroupIds</code>.</p>

<p>I thought that something like this would work :</p>

<pre><code>{
  $match: {
    $or: [
      { user: "5e3d326537df7e4dda73eb23" },
      { sharedWithGroups: { $in: "$userGroupIds" } }
    ]
  }
}
</code></pre>

<p>But I get an error: <code>$in needs an array</code>. I don't understand because <code>$userGroupIds</code> is definitely an array. I've tried using $expr, thinking that the field value may not be resolving, but have had no luck. Is this approach possible, or is there another/better way to filter these documents using multiple criteria?</p>

